//<![CDATA[
class Token {

    constructor(tokenInstance) {
        this.props = tokenInstance;
        this.props.images = {
            "Nuo Network": "data:image/png;base64,",
            "dYdX": "data:image/png;base64,",
            "Maker": "data:image/png;base64,",
            "Fulcrum": "data:image/png;base64,",
            "Compound": "data:image/png;base64,"
        };
        this.getBestRate();
        window.onConfirm = function() { window.close(); }
    }

    getBestRate() {
        let url = 'https://public.defipulse.com/api/GetRates?token=' +
            this.props.label + '&amount=' + this.props.balance / 1e+18;
        fetch(url).then((response) => {
            return response.json();
        })
        .then((json) => {
            console.log(json);
            this.renderHighRate(json);
        });
    }

    renderHighRate(json) {
        let highestRateLend = 0;
        let monthlyReturnLend = 0;
        let rateBorrow = 0;
        let monthlyRateBorrow = 0;
        let serviceName = "";
        Object.keys(json.rates).forEach(function(key, index) {
            if(json.rates[key].lend.rate > highestRateLend) {
                highestRateLend = json.rates[key].lend.rate;
                monthlyReturnLend = json.rates[key].lend.monthlyAmount;
                serviceName = key;
                rateBorrow = json.rates[key].borrow.rate;
                monthlyRateBorrow = json.rates[key].borrow.monthlyAmount;
            }
        });
        let earnMessage = "Earn at " + parseFloat(highestRateLend).toFixed(2) + "% or " + "$USD " +
            parseFloat(monthlyReturnLend) + " per month (with your current balance)";
        let borrowMessage = "Borrow at " + parseFloat(rateBorrow).toFixed(2) + "%";
        document.getElementById("lendMessage").innerHTML = earnMessage;
        document.getElementById("borrowMessage").innerHTML = borrowMessage;
        document.getElementById("service-logo").src = this.props.images[serviceName];
        document.getElementById("service").innerHTML = "Best rate offered by: <strong>" + serviceName + "</strong>";
        document.getElementById("note").innerHTML = "<strong>Rates subject to change at anytime</strong>"
    }

    render() {
        return`
        <div class="ui container">
          <div class="ui segment">
            <img id="service-logo">
            <span><bold><h3 id="lendMessage"></h3></bold></span>
            <span><bold><h3 id="borrowMessage"></h3></bold></span>
            <span><bold><h3 id="service"></h3></bold></span>
            <span><bold><h3 id="note"></h3></bold></span>
          </div>
        </div>
`;
    }
}

web3.tokens.dataChanged = (oldTokens, updatedTokens, tokenCardId) => {
    const currentTokenInstance = updatedTokens.currentInstance;
    document.getElementById(tokenCardId).innerHTML = new Token(currentTokenInstance).render();
};
//]]>

